import { Nav, Navbar, Button, NavDropdown, Col, Container } from 'react-bootstrap';
import './MainContent.css';


export const MainContent = () => (
    <div>
        <h1 class="text-primary">HI</h1>
        <h1 class="text-secondary-dark">HI</h1>
        <h1 class="text-secondary-light">HI</h1>
        <h1 class="text-link">HI</h1>
        <h1 class="text-danger">HI</h1>
    </div>
)
